import React, { Component } from 'react';
class App extends Component {
  state = {data: []}
  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/posts?userId=1').then(res => res.json()).then((data) => {
      this.setState({ data: data })
      console.log(this.state.data)
    })
    .catch(console.log)
  }
  render() {    
    return (
      <section class="container-fluid">
        <div class="row justify-content-center">
          <div class="col-3 rounded border shadow p-3 mb-5 bg-white " id="col-Login">
            <p class="text-center"><strong>Login Admin</strong></p>
              <form class="login-form"  method="POST">
                <div class="form-group" id="errorLogin"></div>
                <div class="form-group">
                  <label>Username</label>
                  <input type="text" id="user" name="user" class="form-control" placeholder="Usuario" required />    
                </div>
                <div class="form-group">
                  <label>Password</label>
                  <input type="password" class="form-control"  id="password" name="password"  placeholder="Password" required />>
                </div>
                <div class="form-group">
                  <button type="submit" class="btn btn-primary float-right">Submit</button>                              
                </div>
              </form>
            </div>
            </div>
      </section>
    );
  }
}
export default App;
